// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awSliderRenderFunction } from 'js/AwSliderService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwSliderService', () => import('js/AwSliderService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awSliderRenderFunction",
            "deps": "js/AwSliderService"
        },
        "createdAction": {
            "actionType": "JSFunction",
            "method": "handleCreate",
            "deps": "js/AwSliderService",
            "inputData": {
                "props": "{{props}}"
            }
        }
    },
    "data": {
        "creationFlag": {
            "dbValue": true,
            "type": "BOOLEAN"
        }
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onMount": "createdAction"
    },
    "i18n": {
        "DecreaseLabel": [
            "BaseMessages"
        ],
        "IncreaseLabel": [
            "BaseMessages"
        ],
        "SliderLabel": [
            "BaseMessages"
        ],
        "LeftSliderLabel": [
            "BaseMessages"
        ],
        "RightSliderLabel": [
            "BaseMessages"
        ]
    },
    "props": {
        "action-defs": {
            "type": "object"
        },
        "prop": {
            "type": "field"
        }
    },
    "_viewModelId": "AwSlider",
    "_uniqueViewModelId": "AwSlider",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awSliderRenderFunction, undefined, ctxImportObj );

export default Component;
